import React from 'react'

const Select = (props: any) => {
    const notSelectedOptions: string[] = props.options.filter((element) => props.selection.includes(element));
    console.log("Not : " + notSelectedOptions);
    const alreadySelectedOptions: string[] = []; 

    return (
        <fieldset>
            <label htmlFor={props.id}>Answer</label>
            <select
            name={props.id}
            id={props.id}
            onChange={props.onChange}
            defaultValue={props.defaultValue}
            >
                <option value="default" disabled>
                - Select -
                </option>
                {props.options.map((element: string, index: number) => <option key={`options ${index}`}>{element}</option>)}
            </select>
        </fieldset>
    )
}

export default Select;

